INSERT INTO `product` (`ProductID`, `ProductName`, `CateID`, `TypeID`, `Price`, `Quantity`, `Description`, `Picture`, `Discount`) VALUES
(1, 'Ford Raptor', 2, 4, 60, 20, 'Ra mắt cuối tháng 10 tại Triển lãm xe VMS 2018, có thể nói Ranger Raptor là một cái tên được chờ đợi nhất với nhiều kì vọng từ khách hàng dành cho chiếc xe Chiến binh Off-Road này.  Thiết kế Tinh xảo  Ford Raptor – Siêu bán tải hiệu năng cao với công suất cực đại chạy bằng động cơ diesel Bi-turbo 2.0L hoàn toàn mới với hai turbo hoạt động độc lập cho công suất 213PS/156,7 KW và mô-men xoắn 500NM tối ưu cao nhất kết hợp hộp số tự động 10 cấp và lẫy chuyển số làm bằng hợp kim ma-giê cao cấp được tích hợp trên vô-lăng bọc da cao cấp cho phép người lái chuyển số rất nhanh mà không cần rời tay khỏi vô-lăng.', 'data:image/jpeg;base64,', 5),
(2, 'Ford Everest', 2, 3, 50, 10, 'Một trong những chiếc xe mới nhất được trình làng cuối năm 2018, Ford Everest Mới là chiếc xe SUV đa năng, chinh phục khách hàng nhờ ngoại hình năng động, công nghệ hiện đại và đương nhiên là khả năng vận hành mạnh mẽ cùng độ an toàn cao.', 'https://cdn-thethao247.com/upload/vananh/2020/05/18/danh-gia-xe-ford-everest-2020.jpg', 10),
(3, 'Ford EcoSport', 2, 3, 25, 40, 'Rộng rãi hơn, tiện nghi hơn. Chuyên gia Đường phố của bạn  SYNC®3 với màn hình cảm ứng 8 inch. Hệ thống SYNC®3 tiên tiến trên Ford Ecosport Mới cung cấp giải pháp tốt nhất cho việc giải trí và kết nối thông tin.  Bấm nút khởi động điện và khoá thông minh với chức năng cảm ứng. Bạn không cần phải lục tìm chìa khoá. Luôn mang chìa khoá bên mình và chỉ cần bạn chạm tay vào nắm cửa- chiếc xe đã được tự động mở khoá.  Hộc đựng đồ kết hợp nghỉ tay trung tâm. Hộc đựng đồ tay hàng ghế phía trước được bọc da sang trọng kết hợp nghỉ tay có thể mở rộng thoải mái hơn. Ngoài ra hàng ghế sau của Ecosport cũng được trang bị tựa tay có khả năng gập kết hợp', 'https://cdn-thethao247.com/upload/namvu/2020/08/26/ford-ecosport-1.jpg', 20),
(4, 'BMW Series 7 Sedan', 1, 1, 180, 3, 'Thiết kế.  \"Chiếc BMW 7 Series này thể hiện quan điểm của chúng tôi thông qua nét sang trọng và hiện đại. Chúng tôi xem việc cải tiến kỹ thuật và chất lượng cao đối với mọi chi tiết cũng quan trọng không kém ngôn ngữ cảm xúc và không gian nội thất thoải mái. Trong quá trình thiết kế, chúng tôi làm việc trên ý tưởng ‘Thi ca của công nghệ’ – cảm nhận về sự tương tác hoàn hảo giữa công nghệ tiên tiến và sự thay đổi trong thiết kế\" - Karim Habib, Giám đốc bộ phận thiết kế ôtô BMW đã chia sẻ.', 'data:image/jpeg;base64,', 5),
(5, 'BMW Series 3 Sedan', 1, 1, 90, 10, 'Thiết kế của BMW 3 Series Sedan thế hệ mới.  Mẫu xe BMW 3 Series luôn dẫn đầu xu hướng. Qua ngôn ngữ thiết kế mới, mẫu xe saloon thể thao đang kết nối lịch sử thành công với tương lai. Mỗi chi tiết trên chiếc xe đều đáp ứng được mong muốn tạo nguồn hứng khởi tuyệt đối khi lái xe.', 'data:image/jpeg;base64,', 5),
(6, 'BMW X5', 1, 3, 300, 20, 'THIẾT KẾ NỘI THẤT VÀ NGOẠI THẤT CỦA BMW X5.  Trên chiếc BMW X5, mỗi một chi tiết nhỏ đều mang sức nặng như một lời tuyên ngôn. Chưa dừng lại ở lưới tản nhiệt siêu khủng có thiết kế hình lục giác, đèn pha với kiểu dáng khác biệt và hệ thống hút gió cực mạnh, chiếc xe này sẽ còn đưa bạn đến với một điều bất ngờ khác: bánh xe hợp kim nhẹ 22” mới mẻ và đột phá.', 'https://files01.danhgiaxe.com/1pO9r5M1VM2kwuG7G5OaYXIriGk=/fit-in/1280x0/20190630/2019-bmw-x5-m50d-blue-front-driving-002239.jpg', 5);
INSERT INTO `product` (`ProductID`, `ProductName`, `CateID`, `TypeID`, `Price`, `Quantity`, `Description`, `Picture`, `Discount`) VALUES
(7, 'Porsche Macan', 3, 2, 250, 3, 'Công suất    324 kW (434 mã lực) Mô men xoắn cực đại    550 Nm Tăng tốc từ 0 - 100 km/giờ (0 - 62 dặm/giờ)    4,5 giây Tốc độ tối đa    270 km/giờ Tiêu thụ nhiên liệu kết hợp (lít/100km)    9,8 Lượng khí thải CO2 (g/km)    224 Giá tiêu chuẩn 4.920.000.000 VNĐ* Giá tiêu chuẩn bao gồm thuế nhập khẩu, thuế tiêu thụ đặc biệt, thuế giá trị gia tăng và gói dịch vụ 4 năm bảo dưỡng. Bảng giá, thông số kỹ thuật và hình ảnh có thể thay đổi theo từng thời điểm mà không báo trước.', 'data:image/jpeg;base64,', 3),
(8, 'Porsche 911 Carrera 4S', 3, 2, 180, 3, 'Công suất    331 kW (450 PS) Mô men xoắn cực đại    530 Nm Tăng tốc từ 0 - 100 km/giờ (0 - 62 dặm/giờ)    3,6 giây Tốc độ tối đa    306 km/giờ Tiêu thụ nhiên liệu kết hợp (lít/100km)    9,7 Lượng khí thải CO2 (g/km)    222 Giá tiêu chuẩn 8.320.000.000 VNĐ * Giá tiêu chuẩn bao gồm thuế nhập khẩu, thuế tiêu thụ đặc biệt, thuế giá trị gia tăng và gói dịch vụ 4 năm bảo dưỡng. Bảng giá, thông số kỹ thuật và hình ảnh có thể thay đổi theo từng thời điểm mà không báo trước.', 'https://www.topgear.com/sites/default/files/styles/16x9_1280w/public/images/cars-road-test/2020/05/d255bb77b11d4f5926157df7f6e6ed27/911_turbos_silver015.jpg?itok=YZXIONH_', 3),
(9, 'Porsche 718 Boxster', 3, 2, 140, 3, 'Công suất    257 kW (350 PS) Mô men xoắn cực đại    420 Nm Tăng tốc từ 0 - 100 km/giờ (0 - 62 dặm/giờ)    4,4 giây (4,2 giây với Gói Sport Chrono) Tốc độ tối đa    285 km/giờ Tiêu thụ nhiên liệu kết hợp (lít/100km)    8,8 Lượng khí thải CO2 (g/km)    200 Giá tiêu chuẩn 4.790.000.000 VNĐ ', 'https://carpassion.vn/wp-content/uploads/2018/12/Porsche-718-Cayman-T-2.jpg', 3),
(10, 'Mercedes-AMG G 63', 4, 3, 500, 2, 'Là một trong những dòng SUV địa hình đến từ Mercedes-Benz, G-Class sở hữu khả năng off-road tuyệt vời. Trong đó, bản hiệu suất cao Mercedes-AMG G 63 được nhiều khách hàng ưa chuộng bởi khả năng vận hành mạnh mẽ, hỗ trợ người lái tối đa trong việc chinh phục những địa hình khó. Sắp tới đây, hãng sẽ cho ra mắt Mercedes-AMG G 63 phiên bản mới với nhiều cải tiến nhằm mang những trải nghiệm tốt hơn nữa đến khách hàng.', 'https://www.vietnamstar.mercedes-benz.com.vn/content/dam/vietnam/retailer/retail-vn/vietnamstar/fp-content/loai-xe/g63/Mercedes-Benz%20G%2063_6.jpg.asset.Qa7SWciT1b-5zSk-Zhzo3bjsk-Iu7YR7p3zvDArQbCk.jpg', 0),
(11, 'Mercedes-Benz GLB 200 AMG', 4, 3, 50, 10, 'Dòng SUV mới Mercedes-Benz GLB chính thức trình làng thị trường Việt Nam với phiên bản Mercedes-Benz GLB 200 AMG 2020. Đây là phiên bản hội tụ đầy đủ những yếu tố mà bạn trông chờ ở mẫu SUV hạng sang: Thiết kế đẳng cấp, động cơ bền bỉ và nhiều trang bị tuyệt vời.', 'https://xesang.com.vn/uploads/images/danh-gia-xe/dg-mercedes/danh-gia-xe-mercedes-glb200-2020-xesang_1.jpg', 1);

